  \"The Economic Impact of Ecotourism on the Malheur National Wildlife Refuge Area,
  Oregon\",\n\t\"tracking_summary\": {\n\t\t\"total\": 233,\n\t\t\"recent\": 10\n\t},\n\t\"groups\":
