  \"the-economic-impact-of-ecotourism-on-the-malheur-national-wildlife-refuge-area-oregon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A study of the economic impact of ecotourism
  and the demographics of ecotourists was conducted at Malheur National Wildlife Refuge,
  Oregon, from June1993-May 1994. The study focused on birding ecotourism because
  that is the primary user group that visits Malheur. A total of 481 questionnaires
  were completed from a total of about 39,750 annual birding ecotourists. Birders
  who visit Malheur tended to be middle aged (30's-40's), well educated (85.4% had
  attended some college), had incomes that were well above the national family average,
  and women and men are about equally represented. A majority did not fish or hunt.
  Visitors came from 28 states, 3 foreign countries, and 30 counties in Oregon.  Forty-five
  percent of visitors were from out of state and 88% stayed more than one day in the
  area. Visitors averaged 3.4 days in the area. The average amount spent on their
  entire trips to and from Malheur averaged about $300 and totaled $12,282,750.  The
  economic impact on the local communities was estimated to be nearly $3.02 million
  in that year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
